If you have not received either dose 1 or dose 2 #CovidVaccine then call to Cavan CVC today Fri 12th or tomorrow Sat 13th 
Please note, boosters for the over 60's and Health Care Workers are by appointment only &amp; cannot be given at walk-in clinics. 
